Mark Watches *Supernatural*, Season 10
----------------------------

Commissioned by his fans to watch Eric Kripke's epic, tragicomical tale of two brothers who criss-cross the US hunting monsters, Mark Oshiro (of Mark Watches, Mark Reads, and Mark Does Stuff fame) takes on the tenth season of the 2005 television series, almost entirely unspoiled. And he is not prepared.

The videos contained herein are of Mark watching and reacting to the series, *NOT* the actual episodes of season ten of *Supernatural*.


Reviews written by Mark after watching each episode can be found here:  &lt;a href=&quot;
http://markwatches.net/reviews/category/supernatural/?order=asc&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://markwatches.net/reviews/category/supernatural/?order=asc&lt;/a&gt;


